k out this playlist:\nhttps://www.youtube.com/playlist?list=PLEbhOtC9klbCr0iN2ANJbaV477B0eSpc6\n\nTo make sure you never miss a single Rubin Report video, click here to subscribe:\nhttps://www.youtube.com/channel/UCJdKr0Bgd_5saZYqLCa9mng?sub_confirmation=1\n\nLooking for smart and honest conversations about current events, political news and the culture war? Want to increase your critical thinking by listening to different perspectives on a variety of topics? If so, then youre in the right place because on The Rubin Report Dave Rubin engages the ideas of some of society's most interesting thought leaders, authors, politicians and comedians. The Rubin Report is the largest talk show about free speech and big ideas on YouTube. \nDave allows his guests to speak their minds and his audience to think for themselves.\nNew videos every week.\n\nThe Rubin Report is fan funded through monthly and one-time donations: http://www.rubinreport.com/support\n\n******\n\nDave Rubin's book, \"Don't Burn This Book\" is now available for pre-order: www.dontburnthisbook.com\n\nLISTEN to The Rubin Report podcast: www.rubinreport.com/podcast\n\nSee Dave LIVE:  https://daverubin.com/events/\n\nSign up for our newsletter with the best of The Rubin Report delivered to your inbox once a month: http://www.rubinreport.com/newsletter\n\nOfficial Rubin Report Merchandise: https://rubinreport.com/shop\n\nAll art on the set are original works by Caylin Rose Janet. \nGet a print here: https://www.caylinrosejanet.com/rubinreportart.html\n\n******\n\nBen Shapiro\nEditor-in-Chief of The Daily Wire, and Editor-at-Large of Breitbart\nBen Shapiro on Twitter: https://twitter.com/BenShapiro\n\n******\nFollow Dave on Twitter: https://twitter.com/RubinReport\nFollow The Rubin Report on Facebook: https://www.facebook.com/rubinreport\nFollow Dave on Facebook: https://www.facebook.com/daverubin\nAbout Dave Rubin: http://daverubin.com/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/ 477B0eSpc6\u0026index=31\u0026t=0s\n\nIs the state of US news driving you crazy? Does the coverage of political news rarely seem fair and balanced? Serious discussions on US politics is vital to having a healthy democracy. No matter what political party you belong to, we need to be able to hear a variety of political perspectives. Whether you majored in political science or just want to have a deeper understanding of the issues youll want to check out this playlist:\nhttps://www.youtube.com/playlist?list=PLEbhOtC9klbCr0iN2ANJbaV477B0eSpc6\n\nTo make sure you never miss a single Rubin Report video, click here to subscribe:\nhttps://www.youtube.com/channel/UCJdKr0Bgd_5saZYqLCa9mng?sub_confirmation=1\n\nLooking for smart and honest conversations about current events, political news and the culture war? Want to increase your critical thinking by listening to different perspectives on a variety of topics? If so, then youre in the right place because on The Rubin Report Dave Rubin engages the ideas of some of society's most interesting thought leaders, authors, politicians and comedians. The Rubin Report is the largest talk show about free speech and big ideas on YouTube. \nDave allows his guests to speak their minds and his audience to think for themselves.\nNew videos every week.\n\nThe Rubin Report is fan funded through monthly and one-time donations: http://www.rubinreport.com/support\n\n******\n\nDave Rubin's book, \"Don't Burn This Book\" is now available for pre-order: www.dontburnthisbook.com\n\nLISTEN to The Rubin Report podcast: www.rubinreport.com/podcast\n\nSee Dave LIVE:  https://daverubin.com/events/\n\nSign up for our newsletter with the best of The Rubin Report delivered to your inbox once a month: http://www.rubinreport.com/newsletter\n\nOfficial Rubin Report Merchandise: https://rubinreport.com/shop\n\nAll art on the set are original works by Caylin Rose Janet. \nGet a print here: https://www.caylinrosejanet.com/rubinreportart.html\n\n******\n\nBen Shapi
